export const mapImages = {
  province: "/images/province.webp",
  rust: "/images/rust.webp",
  sandstone: "/images/sandstone.webp",
  sakura: "/images/sakura.webp",
  breeze: "/images/breeze.webp",
  dune: "/images/dune.webp",
  "zone 7": "/images/zone7.webp",
} as const;

export type MapName = keyof typeof mapImages;
